import React from 'react'

export const VisualizarFicha = (props) => {
    const {datosFicha} = props
    return (
        <div className="card p-3">
            <div className="row text-end">
                <div className="col ">
                    {datosFicha.fecha_ficha}
                </div>

            </div>
        </div>

    )
}
